<div class="entities" style="line-height: 2.5; direction: ltr">Agents that block fibronectin fragment-mediated cartilage damage also promote repair . OBJECTIVE AND DESIGN : The objective was to determine if agents that suppress catabolism might also enhance repair of irreversibly damaged cartilage . MATERIAL : Articular cartilage from bovine metacarpophalangeal joints was studied in explant culture . TREATMENT : 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P02751
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 fragments or 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01583
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , which potently cause proteoglycan ( PG ) loss from cartilage , were added to cultures also containing the catabolism-blocking agents : insulin-like growth factor - 1 , or DB06151 , or DB00125 - DB00145 - DB00128 - DB00133 peptide , and the effects of these agents on blocking PG loss determined . To test for repair or restoration of PG , cartilage was first damaged , damage agents removed and inhibitory agents added . METHODS : Each mean and SD value for cartilage PG content was determined by assays of papain digests of cartilage from three similar cultures . RESULTS : The agents either partially or fully blocked PG loss and promoted repair . CONCLUSIONS : Normally irreversible cartilage damage was reversed by slowing ongoing catabolic processes during attempted repair . Thus , catabolic inhibitors have reparative potential .</div>

 ) inhibitor-stimulated glucose metabolism and perfusion in muscle tissue seem to be , at least in part , mediated by kinins . However , the relative contribution of direct metabolic or secondary hemodynamically induced effects is unclear . It was the aim of this study to characterize the effects of

 inhibition and bradykinin on glucose transport while changes in cardiocoronary function that might influence glucose transport were minimized . Hearts from Wistar rats were perfused by a Langendorff preparation and a set of functional parameters were simultaneously measured . Bradykinin ( 10 [ - 11 ] M ) and fosinoprilate ( 10 [ - 7 ] M ) were administered at concentrations that did not affect coronary flow .

 antagonist

<h2 style="margin: 0">17</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">An analysis of the effects of retinoic acid and other retinoids on the development of adrenergic cells from the avian neural crest . In the present work , we have investigated the role of all-trans-retinoic acid ( all-trans RA ) , and several other natural and synthetic retinoids , in the development of adrenergic cells in quail neural crest cultures . Dose response studies using all-trans RA and 13 - cis RA revealed a dose-dependent increase in the number of adrenergic cells in neural crest cultures . Similar dose response studies using RA isomers and other natural retinoids did not result in the same increases . In order to determine the receptor mediating the effects of all-trans RA in the neural crest , we tested several synthetic analogs which specifically bind to a particular RA receptor ( RAR ) subtype . We found that the compound AM 580 , which activates the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , produced an increase in adrenergic cells similar to that seen with all-trans RA . The compound 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 , which activates all RAR subtypes , also resulted in an increase in adrenergic cells . We conclude that the increase in adrenergic cells seen with all-trans RA is mediated by 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 and possibly 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 . To further define the actions of all-trans RA on the neural crest we incubated cultures with 5 - bromo - 2 ' - deoxyuridine ( BrdU ) to determine whether all-trans RA could affect the rate of proliferation . The results show that while all-trans RA did not increase the fraction of cells incorporating BrdU into their nuclei at early time points ( 24 h ) , it did increase BrdU incorporation by tyrosine hydroxylase ( TH ) positive cells at 5 days in culture . These findings demonstrate that the increase in adrenergic cells seen with all-trans RA in neural crest cultures is likely due to an increase in the proliferation of cells already expressing TH .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Quantification of raf antisense oligonucleotide ( rafAON ) in biological matrices by LC-MS / MS to support pharmacokinetics of a liposome-entrapped rafAON formulation . An LC-MS / MS method was developed to quantify an antisense oligonucleotide against 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 expression ( rafAON ) in monkey and mouse plasma and in mouse tissue homogenates from animals dosed with a liposome-entrapped rafAON easy-to-use formulation ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 - ETU ) intended for use as an antineoplastic agent . RafAON was extracted from mouse and monkey plasma using solid-phase extraction . Tissues were homogenized and sample cleanup was achieved by protein precipitation . RafAON and the internal standard ( IS ) were separated on a Hamilton PRP - 1 column and quantified by tandem mass spectrometry using an electrospray source in negative ion mode . The total run time was 4.0 min . The peak areas of two rafAON transitions were summed and plotted against the peak area of an IS transition to generate the standard curve . In monkey plasma the linear range was 50-10 , 000 ng / mL , and in mouse plasma it was 25-5000 ng / mL . The lower limit of quantification was 500 ng / mL ( 10 microg / g tissue ) in heart , kidney , liver , lung and spleen homogenates , and the standard curve was linear up to 10,000 ng / mL . Accuracy , precision and stability were evaluated and found to be acceptable in all three matrices . The assay was used to support pharmacokinetics and tissue distribution studies of
